import "./nav.css";

import star from "../../assets/star_icon.png";

import logout from "../../assets/logout_icon.png";

import search from "../../assets/search_icon.png";

const Nav = () => {
  return (
    <div className="nav">
      <div className="search-nav">
        {" "}
        <img className="icon search-icon" src={search} alt="search icon" />
      </div>
      <div className="profile-nav">
        <div className="circle">J</div>
      </div>
      <div className="favorites-nav">
        <img className="icon fav-icon" src={star} alt="favorites icon" />
      </div>
      <div className="logout-nav">
        {" "}
        <img className="icon logout-icon" src={logout} alt="logout icon" />
      </div>
    </div>
  );
};

export default Nav;
